    [],nt"revision_timestamp": "2015-08-21T22:34:57.583661",nt"name": "emergency-department-integration-software-edis",nt"isopen":
    true,nt"url": null,nt"notes": "The Emergency Department Integration Software
    (EDIS) is a VHA-wide application used to track and manage the delivery off care
    to patients in the Emergency Care System (ECS).  This critical IT solution directly
    supports the Major Initiative 'Enhance the Veteran Experience and Access to Healthcare
    (EVEAH).  EDIS v1.0 is currently being deployed in each VHA hospital and is scheduled
    for deployment completion by 7/31/2011.  The application improves emergency department
    care by introducing the systematic collection, display and reporting on patient
    status information.  It is able to integrate with Appointment Management and Patient
    Care Encounter within VistA.  EDIS v2.0 is currently being planned and will provide
    enhancements, better functionality and improved reports.",nt"license_title":
